import BaseWidget from '../base_widget'
import WebContent from './src/WebContent'
import WebOptions from './src/WebOptions'

export default class Web extends BaseWidget {
  constructor() {
    super({
      name: 'video',
      version: '0.1',
      icon: 'instagram',
      defaultData: {
        title: null,
        url: null,
        fit: 'contain',
        color: '#2d3436'
      }
    })
  }

  get Widget() {
    return WebContent
  }

  get Options() {
    return WebOptions
  }
}
